import Vue from 'vue';
export default Vue.extend({
  computed: {
    dialog(): HTMLDialogElement {
      return this.$refs.dialog as HTMLDialogElement;
    },
    src(): string {
      return this.$store.state.preview;
    },
  },
  watch: {
    src(val) {
      if (val) {
        this.dialog.showModal();
      } else {
        this.dialog.close();
      }
    },
  },
  methods: {
    hidden() {
      this.$store.commit('previewImage', '');
    },
  },
});
